export const LOGO ='assets/images/logo.ico';
export const MODULO1 ='assets/images/angular14.png';
export const MODULO2 ='assets/images/java.png';
export const MODULO3 ='assets/images/despliegue.png';
export const PAGE_NOT_FOUND ='assets/images/404.png';

export const EMAIL_VALIDATE=
'^[_A-Za-z0-9-\\+]+(\\.[_A-Za-z0-9-]+)*@[A-Za-z0-9-]+(\\.[A-Za-z0-9]+)*(\\.[A-Za-z]{2,})$';

export const NAME_VALIDATE=
'^([A-Za-z]+[ ]?){1,2}$';

export const NUMBER_VALIDATE=
'^[0-9]+([\\.,][0-9]+)?$';
